INSERT INTO `contacts` VALUES (1,'Eola Tennis Academy','College Tennis Preparatory Academy','logo.jpeg','Newest indoor tennis facility in Chicagoland area. Home of Eola Tennis Academy, high performance tennis training and college tennis preparatory academy. Eola Tennis Academy offers tennis classes for all levels and ages, court rentals, tournament and leagues.\n2390 S Eola Rd Aurora, IL 60503\n(630) 800-2220 \neolatennis.com'),(2,'Gus Fernandes','Head Coach','gus.jpeg','Head Coach - High Performance Coach\nHas trained multiple NCAA Division I players\nCall or Text Gus at 630-699-1711 to arrange privates\n\nOne hour private: $60\n30 min private: $38\nSummer 10 Hour Pack: $550 - Valid 6/4/18 to 8/12/18. No exceptions.'),(3,'Christain Lynn','Tennis Professional','christian.jpeg','Call or Text 815-735-7706 to arrange privates\nOne hour private: $65\n30 min private: $33'),(4,'John Mittvick','Tennis Professional','mittvick.jpeg','Call or Text 847-385-8591 to arrange privates\nOne hour private: $50\n30 min private: $30\n1.5 hour private: $75\nSummer 10 Hour Pack: $470 - Valid 6/4/18 to 8/12/18. No exceptions.'),(5,'Elisa Hougland','Tennis Professional','elisa.png','Call or Text 224-501-2624 to arrange privates\nOne hour private: $65\n30 min private: $33'),(6,'Lance Gorman','Tennis Professional','lance.jpeg','Call or Text 630-335-0207 to arrange privates\nOne hour private: $65\n30 min private: $37'),(7,'Karen O\'Sullivan','Director of Adult Tennis','karen.jpeg','Call 630-335-0207 or email osullivandaisy@aol.com to arrange privates\nOne hour private: $80\n30 min private: $40'),(8,'Vanesa Baker','Tennis Professional','logo.jpeg','Call or Text 630-362-0424 to arrange privates One hour private: $65 30 min private: $37'),(9,'Justin Ancona','Tennis Professional','justin.png','Call or Text 815-914-5755 to arrange privates One hour private: $80 30 min private: $40');
